import React, { Component } from 'react';
import { Router, Switch, Route } from 'react-router-dom';

import App from './App';

export default class Routes extends Component {
    render() {
        return (
            <Router history = {history}>
                <Switch>
                    <Route path='/' exact component={App} />
                    </Switch>
            </Router>
        )
    }
}
